			},
			["preferToUpdate"] = false,
			["customText"] = "--[[\nif using a Timed duration info then:\n    function(expirationTime, duration, progress, formatedDuration, name, icon, stacks) \n     \"progress\" is a formatted string and shouldn't be used for arithmetic\n     \"duration\" is simply the number of seconds\n     \"formatedDuration\" is a formatted string showing minutes if applicable\n\nif using a Static duration info then:\n    function(total, value, value, total, name, icon, stacks)\n    \n \"icon\" is a formatted string with escape sequence setup to display the texture\n\nExpected return:\n    return text (string)\n Can return nil\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Text-Replacements\n]]\n\nfunction() \n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 20.000183105469,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["cooldownEdge"] = false,
			["actions"] = {
				["start"] = {
					["custom"] = "--[[\n No `function() ... end` required. \n Nothing sent in. \n No return expected. \n\nThis is simply an area that can be used to run some code.\n\nRUNS ONCE AS THE AURA IS TRIGGERED (SHOWN). TO TRIGGER AGAIN THE AURA MUST COMPLETELY UNTRIGGER THEN RETRIGGER.\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Custom-Actions\n]]",
					["do_custom"] = true,
				},
				["finish"] = {
					["custom"] = "--[[\n No `function() ... end` required. \n Nothing sent in. \n No return expected. \n\nThis is simply an area that can be used to run some code.\n\nRUNS ONCE AS THE AURA IS HIDDEN (UNTRIGGERED). TO RUN THIS CODE AGAIN THE AURA MUST TRIGGER THEN UNTRIGGER AGAIN.\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Custom-Actions\n]]",
					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "--[[\n No `function() ... end` required. \n Nothing sent in. \n No return expected. \n\nThis is simply an area that can be used to run some code.\n\nRUNS ONCE WHEN THE AURA IS FIRST LOADED THEN NEVER AGAIN UNTIL A UI RELOAD OR WA CONFIG OPENED AND CHANGES MADE TO THIS CODE BLOCK\n\nThis code block is exceptionally usaful for creating settings, or tables of info, or functions. Create vars/objects like this in `aura_env` and they will load only once but can be used throughout your Aura.  \n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Custom-Actions\n]]\n\n\n\n\n",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["genericShowOn"] = "showOnActive",
						["unit"] = "player",
						["customIcon"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n     Path\n        return path (string) \n        \n    e.g. \"Interface\\\\Icons\\\\Ability_ambush\"\n\n     IconID\n        return iconID (number)\n    \n    e.g. 132089\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#icon-info\n]]",
						["debuffType"] = "HELPFUL",
						["customOverlay1"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n     For non-moving overlays:\n        return left value (number), right value (number)\n        \n        The values are relative to the \"duration\" of an Aura with \"timed\" DurationInfo, or \"total/max\" value of an Aura with \"static\" DurationInfo.\n\n     For moving overlays:\n        return \"Forward\" or \"backward\" (string), width (number)\n\n        Again the number value is relative to the \"duration\" or \"total\". But this time a string sets whether the overlay runs ahead of or behind the moving edge of the progress.  \n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#custom-overlays\n]]",
						["type"] = "custom",
						["names"] = {
						},
						["subeventSuffix"] = "_CAST_START",
						["custom_type"] = "status",
						["spellIds"] = {
						},
						["event"] = "Health",
						["customStacks"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n    return value (number)\n\n*There is a text frame called \"stacks\" (named because it was originally intended simply to display this value) that can show strings, this \"Stacks\" dynamic info must only be a number. \n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#stack-info\n]]\n\n\n\n\n\n\n\n\n\n",
						["customDuration"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n     Timed durations:\n        duration (number of seconds), expirationTime (number of seconds, relative to the value of GetTime())\n    \n     Static values:\n        value (number), total / maximum value (number), true\n        (the \"true\" as the third return tells WA that it's a static type)\n\nThe values set here set the Aura's main progress as well as setting texts like %p, %t, etc.\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#duration-info\n]]",
						["customName"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n    return name (string)\n\nThe value given here can be accessed in text using %n\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#name-info\n]]",
						["events"] = "EVENT_NAME",
						["custom"] = "--[[\nif using \"TSU\" type then:\n    function(allstates_table, event_name, arg1, arg2, ...)\n\nif using \"event\" type or \"status - event\" type then:\n    function(event_name, arg1, arg2, ...)\n\nif using \"status\" type then:\n    function()\n\nExpected return:\n    Boolean\n Can return nil (same as returning false)\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Custom-Triggers\n]]",
						["check"] = "event",
						["customTexture"] = "--[[\nThe trigger table is sent into this function as the only arg. This is mostly for internal WA reasons and is very unlikely to be useful to users. \n    function(trigger_table)\n\nExpected return:\n     Path\n        return path (string) \n        \n    e.g. \"Interface\\\\Icons\\\\Ability_ambush\"\"\n\n     IconID\n        return iconID (number)\n    \n    e.g. 132089\n\n(identical to Icon Info but for texture type Auras)\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Dynamic-Information#texture-info\n]]",
						["subeventPrefix"] = "SPELL",
						["customVariables"] = "--[[\n\nDefine a table which will setup the WA config to be able to include custom state fields as Condition variables, also sets up Overlays so their colours can be set in Display.\n\nOverlays:\nOverlays are set with the field `additionalProgress` and should be given a number value for the number of overlays your TSU bars could use. \n    \n    additionalProgress = 4\n\nConditions:\n\nConditions can be set in slightly different ways depending on the complexity required.\n\nStandard Conditions:\nIf you want to include \"standard\" conditions from your TSU clones then you can simple decalre them to be true:\n\n    expirationTime = true,\n    stacks = true,\n\nCustom Conditions:\nTo include your own custom state fields in the Conditions settings you need to tell WA the type of variable that field represents. The options are \"bool\", \"string\", \"number\". \n\n    var1 = \"bool\"\n    var2 = \"number\"\n\nComplex Custom Conditions:\nInstead of simply setting the type of variable you can use a table to set a display name. You would also use this table to access the \"select\" Condition type. The \"select\" type lets you define a series of optional values which will appear as a dropdown selection. These should be defined in a table with each `key` being the value set on the state and the `value` being what should be visible to users in Conditions. \n\n    var1 = {\n        display = \"my var name\",\n        type = \"string\"\n    }\n    var2 = {\n        display = \"var2\",\n        type = \"select\",\n        values = {\n            [\"yes\"] = \"yes\", \n            [\"no\"] = \"no\", \n            [\"maybe\"] = \"maybe\"\n        }\n    }\n\nAll these approaches to settings can be mixed and matched as you need.\nA Full Example:\n\n{\n    additionalProgress = 1,\n    \n    expirationTime = true,\n    stacks = true,\n    \n    unit = \"string\",\n    \n    var3 = {\n        display = \"colour\",\n        type = \"select\",\n        values = {\n            red = \"red\",\n            blue = \"blue\",\n            green = \"green\",\n        }\n    }\n}\n\n]]",
					},
					["untrigger"] = {
						["custom"] = "--[[ \nAll args from the trigger are also sent to the untrigger. See Trigger for details.\n\nif left blank will default to :\nfunction()\n    return true\nend\n\nExpected return:\n    Boolean\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Custom-Triggers\n]]\n\n\n\n\n\n\n\n",
					},
				}, -- [1]
				["disjunctive"] = "custom",
				["customTriggerLogic"] = "--[[\nfunction(triggers)\n\nCustom Activation Functions are sent an \"array\" table containing all the Aura's triggers as booleans. Naming the incoming arg as above, `triggers[1]` will give the current status of trigger 1, and so on. \n\nExpected return:\n    return Boolean\n\nWiki: https://github.com/WeakAuras/WeakAuras2/wiki/Aura-Activation-and-Deactivation#custom\n]]\n\n\n\n\n\n\n\n\n\n\n\n",
