			["customText"] = "function()        \n    local percentage = aura_env.count * 3;\n    local text = percentage ..\"%%\\n\" .. aura_env.count;   \n    \n    return text;\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
